        graph[edge[0] - 1].append(edge[1] - 1)
        graph[edge[1] - 1].append(edge[0] - 1)
    visited = set()
    def dfs(node, parent, graph):
        visited.add(node)
        for n in graph[node]:
            if n == parent:
                continue
            elif n not in visited:
                dfs(n, node, graph)
    count = 0
