        if v not in visited:
            dfs(v, v, graph)
            count += 1
    return str(count)

def solution(stdin: str) -> str:
    """Finds if it is possible to split the sequence into two sequences, one increasing and one decreasing.

    Args:
        stdin (str): The input.

    Returns:
        str: Yes if it is possible, otherwise no.
    """
    n = int(stdin.split()[0])
    sequence = list(map(int, stdin.split()[1:]))
    i, j = 0, n - 1
    while i < j:
        if sequence[i] <= sequence[j]:
            i += 1
        else:
            j -= 1
    increasing = []
    for x in sequence[:i + 1]:
        increasing.append(1 if x >= 0 else 0)
    decreasing = []
    for x in sequence[i:]:
        decreasing.append(1 if x <= 0 else 0)
    return 'YES\n' +''.join(str(x) for x in increasing) + '\n' +''.join(str(x) for x in decreasing)

