    def merge_and_sort(arr, low, mid, high):
        sorted_arr = []
        i, j = low, mid + 1
        while i <= mid and j <= high:
            if arr[i] < arr[j]:
                sorted_arr.append(arr[i])
                i += 1
            else:
                sorted_arr.append(arr[j])
                j += 1
