    def sort_and_take(arr, low, high):
        if high - low < 2:
            return arr[low: high + 1]
        mid = (high - low) // 2 + low
        sort_and_take(arr, low, mid)
        sort_and_take(arr, mid + 1, high)
        merge_and_sort(arr, low, mid, high)
        return arr
    def rotate(arr, k):
        n = len(arr)
        if k <= 0 or k >= n:
            return arr
        return sort_and_take(arr, 0, n - 1)
