    art = []
    for _ in range(n):
        art.append(list(map(int, stdin.split(' '))))
    art = [[art[j][i] for j in range(n)] for i in range(n)]
    lst = [[0 for j in range(n)] for i in range(n)]
    def hop(i, j, distance):
        if i == n-1 and j == n-1:
            return distance
        if i < n and j < n:
            if art[i][j] == k:
                lst[i][j] = 1
                return distance
            if art[i][j] == 0:
                return hop(i, j+1, distance+1)
            if art[i][j]!= k and art[i][j]!= 0:
                if lst[i][j] == 0:
                    lst[i][j] = 1
                    return hop(i+1, j, distance+1)
                if lst[i][j] == 1:
                    return hop(i, j+1, distance+1)
    if hop(0, 0, 0) == -1:
        return -1
    return hop(0, 0, 0)

